import React, { Component } from "react";
import { Platform } from "react-native";
import { Ionicons } from "@expo/vector-icons";
import {
  TabNavigator,
  TabBarBottom,
  createTabNavigator,
} from "react-navigation";
import Design from "../src/firebase/Design";
import {
  HomeScreen,
  QuestScreen,
  NutritionalScreen,
} from "../components/ScreenComponents";

// const TabNavigation = createTabNavigator();

export default TabNavigator(
  {
    Home: { screen: HomeScreen },
    Quest: { screen: QuestScreen },
    NutritionalTips: { screen: NutritionalScreen },
  },
  {
    navigationOptions: ({ navigation }) => ({
      tabBarIcon: ({ focused }) => {
        const { routeName } = navigation.state;
        let iconName;
        switch (routeName) {
          case "Home":
            iconName =
              Platform.OS === "ios"
                ? `ios-information-circle${focused ? "" : "-outline"}`
                : "md-information-circle";
            break;
        }
        return (
          <Ionicons
            name={iconName}
            size={28}
            style={{ marginBottom: -3 }}
            color={focused ? Design.tabIconSelected : Design.tabIconDefault}
          />
        );
      },
    }),
    tabBarComponent: TabBarBottom,
    tabBarPosition: "bottom",
    animationEnabled: false,
    swipeEnabled: false,
  }
);
